  input: 'TEXT,F3XA,,"Mr. Nicholas T. Ebinger Reports Analyst Dear Mr. Ebinger: I
    am writing in response to your letter dated February 13, 2001 reagding the Mid-Year
    Report for the 2001 President''s Dinner Committee.  You requested that the Committee
    provide a detailed description of our procedures for obtaining the full name,
    address, occupation and employer.  Each solicitation from the Committee contains
    a request for the inmformation in a clear and conspicous manner.  If the contributor
    does not provide the necessary information, a letter is sent from the Treasurer
    within 10 days informaing the donor of the legal requirements and requesting the
    information.  This follow-up request is accompanied by a pre-addressed, stamped
    envelope.  If the information is then received from the donor, that information
    is added to our next regular filing.  I have sent copies of the original solicitation
    and the follow-up letter for your review.  Schedule H3 supporting line 18 has
    been amended to include the breakdown of transfers and to include the information
    on lines i), ii)e), and iii)e).  You have requested information regarding the
    administrative expenses of the Committee.  You will note that the Committee is
    a joint fundraising committee.  All expenses are related to the fundraising function.  The
    Committee does not have an office of its own, however there are many other administrative
    type expenses; ie payroll."'
